  return (
    <div style={{ padding: 24 }}>
      <h2>Admin Dashboard</h2>
      <p>Manage stores, zones, locations, and staff.</p>
      {/* Admin management UI will go here */}
    </div>
  );
}

export default function AdminApp() {
  return (
    <Routes>
      <Route path="/" element={<AdminDashboard />} />
    </Routes>
  );
}
